message:
*ATENÇÃO! É TEMPO DE GUERRA! URGENTÍSSIMO! LEIA E REPASSE...*

🇧🇷 *INFORMAÇÕES  INTERNAS DAS FORÇAS ARMADAS, PASSADAS HOJE, 28 DE DEZEMBRO DE 2022, PARA A SUA SEGURANÇA:*

A partir de amanhã reprograme suas viagens. Tente ficar sempre o mais próximo de sua família possível; 

No máximo entre amanhã ou depois, à meia noite os aeroportos serão fechados, somente emergência e forças militares ocuparão o espaço aéreo. Os Portos também;

A ponte Rio-Niterói e rodovias federais também terão restrições para passar, somente emergência e justificativas documentadas plausíveis  passarão;

Não confie em ninguém estranho ou que não se indentifique de maneira plausível;

Não coma nada que provenha de estranhos ou que não saiba a procedência;

Ter em casa: velas, lamparinas, pilhas, rádio a pilhas, pois haverá possível corte de energia e internet. Comunique-se com parentes passando-lhes orientações do que fazer caso não consiga mais se comunicar;

Tenha alimentos em casa, em sua maioria que não dependam de refrigeração, por no mínimo 15 dias de duração para sua família, afim de evitar ter que sair de casa;

Tenha pelo menos 1 botijão de gás reserva a mais;

Abasteça sua casa de remédios, gases e curativos. Kit Básico de Primeiros Socorros.
Se, em caso extremo precisar sair de casa, saia com documentos, certidões pessoais e de moradia fixa, carteira de trabalho, cartões comprovando suas profissões ou trabalho fixo, ou comprovante de trabalhos alternativos, MEI, CNPJ. Orientação para todos os integrantes da família, inclusive certidão de nascimento de crianças;

Cisternas e caixas de água: mantenham-nas cheias, e quem tiver poço poderá ter que puxar a água na manivela de mão.

*Manter a máxima calma, equilíbrio, fé, coragem... amor a si próprio, ao próximo, ao país e a Deus em primeiro lugar, orando sem cessar.* 

Somente repasse para pessoas de confiança e que tenham compreensão do que está  acontecendo ou do que irá  acontecer.
     
Atenciosamente, 
*General Girão*
